(function(n){new Vue({el:"#app",data:{entity:pageObj.business,showError:!1},methods:{ret:function(){history.go(-1)},save:function(){var t=this.entity;if(!t.appId||!t.secret){n.alert("请将信息填写完整");this.showError=!0;return}this.showError=!1;n.loading();axios.post("/business/savesmall",{appId:this.entity.appId,secret:this.entity.secret}).then(function(t){if(n.loaded(),!t.data.success){n.alert(t.data.msg);return}n.alert("保存成功","success")}).catch(function(t){n.loaded();n.alert(t)})}}})})(jQuery);